Seat Altea 1,6 102 KM, 2007 r. , benzyna + gaz (instalacja BRC). Przebieg 260937km.

Przegląd okresowy ważny do lutego 2026 r. 

Ubezpieczenie ważne do kwietnia 2026 r. Badanie szczelności zbiornika LPG ważne do 2031 r. 

Samochód kupiłem w maju 2015 r. i od tego czasu stale użytkuję. Samochód bardzo funkcjonalny,  tani w eksploatacji, mało awaryjny. Środek zadbany i czysty. Wewnątrz nie były palone papierosy. Na karoserii widoczne drobne ogniska korozji. Samochód zawiera otarcie prawych drzwi oraz nadkola prawego (jak na zdjęciach). Sprzedaż wynika z faktu zakupu przeze mnie nowego auta.

